import React from 'react';

function Food({fav}){
  console.log(props.fav)
  return <h1>I am a potato</h1>;
}

function App() {
  return (
    <div>
      <h1>Hello!</h1>
      <Food 
        fav = "kimchi"
      />
    </div>
  );
}

export default App;
